game.showLongText("Break as many tiles as possible! Keep the ball alive! Press B to launch.", DialogLayout.Bottom)
if (controller.A.isPressed()) {
    startGame()
}
game.onUpdate(function () {
    if (startBallVar == 0) {
        ballvar.setPosition(paddle.x, 105)
        ballvar.setVelocity(0, 0)
        if (controller.B.isPressed()) {
            startBallVar = 1
        }
    }
    if (startBallVar == 1) {
        ballvar.setVelocity(Math.randomRange(-30, 30), -50)
        startBallVar = 2
    }
    if (ballvar.y > 115) {
        startBallVar = 0
        info.changeLifeBy(-1)
    }
})
forever(function () {
    if (numBricks <= 0) {
        numBricks = 0
        startBallVar = 0
        effects.confetti.startScreenEffect()
        pause(2000)
        effects.confetti.endScreenEffect()
        buildSetBricks()
        info.changeScoreBy(100)
    }
})
